import styled from 'styled-components';
import './Home.css';

import React from 'react';
import logo from "./spotify.png";



const StyledImg = styled.img`
  width: 250px;

`;


function Home() {
  return (
    <div className='home'>
      <StyledImg src={logo} alt="Logo"></StyledImg>
      <div className='home2'>
      <a href="1">Artists</a>
      <a href="2">Albums</a>
      <a href="3">Genres</a>
      <a href="4">Tracks</a>
      <a href="5">Albums genres</a>
      </div>
      </div>


  )

}

export default Home;
